import React, {useEffect, useState} from "react";
import axios from "axios";
import swal from "sweetalert";
import TextInput from "../../../../common/TextInput/TextInput";
import Button from "../../../../common/Button/Button";

export default function DevelopProduct({employee}) {

    const [name, setName] = useState('');
    const [premium, setPremium] = useState('');


    const handleSubmit = async (e) => {
        e.preventDefault();
        await axios.post('http://localhost:40055/api/product/create', {
            name: name,
            premium: premium,
        })
            .then(response => {
                if (response.data === '')
                    alert('상품 등록에 실패했습니다.');
                else {
                    alert('상품이 등록되었습니다.');
                }
            })
            .catch(error => {
                swal({
                    title: '시스템 오류',
                    text: '잠시후 다시 시도해주세요. 불편을 드려 죄송합니다.',
                    icon: 'error',
                    button: '확인',
                });
            });
    };

    if (employee.department !== "DEVELOPMENT") {
        swal({
            title: '권한 없음',
            text: '개발팀만 이용 가능한 메뉴입니다.',
            icon: 'error',
            button: '확인',
        });
        return null;
    }
    return (
        <form onSubmit={handleSubmit}>
            <TextInput text={'상품 이름'} value={name} onChange={(e) => setName(e.target.value)}/>
            <TextInput text={'보험료'} value={premium} onChange={(e) => setPremium(e.target.value)}/>
            <Button text={'제출'}/>
        </form>
    );


}
